window.bookSummaryJSON = "<p><b>Everything should be fine.</b></p> <p>The Brid is dead. I'm the new Seelie king. And Lonan is with me, safe from the Unseelie queen—his mother—and terrible brothers.</p> <p>But it's not fine. Nothing is fine.</p> <p>I can't seem to let go of my old life, even as this new one—and my new responsibilities—overwhelm me. Something is wrong with Lonan. He's closing himself off even more. He's quiet and distant, and every day, the rift between us seems to get bigger, no matter what I do.</p> <p>I know he wants to go and take his crown. I know he doesn't feel right here in this place that's too hot, and too crowded, and too different from his home., But I can't bring myself to let him go. I've already lost everything once. I can't stand the thought of losing him.</p> <p>But something is happening to me, and I don't know how to stop it. I can feel myself changing, becoming something uglier, darker, further and further from who I once was.</p> <p>Lonan is the only thing stopping me from getting swallowed up completely by whatever now possesses me, but my desperation to keep him close just seems to be driving him further away. And that scares me more than anything.</p> <p>King of Death <i>is the final installment in Folk, an MM fae romance trilogy about a dark fae assassin prince and a mortal thrown into the cruel world of the Folk. HEA guaranteed. For mature listeners.</i></p>"; 
